    <>
    <Nav />
    <h2 style={{color:"black",marginTop:"30px"}}>Load Deformation Test Results :-</h2>
    <hr></hr>
    <Link style={{ textDecoration: 'none' }} to="silico"><Button name=" Silico Manganese Slag"></Button></Link>
    <Link style={{ textDecoration: 'none' }} to="silico"><Button name="Mixer"></Button></Link>

    <Link style={{ textDecoration: 'none' }} to="fly"> <Button name="Fly Ash"></Button></Link>
    <h5>

    </h5>
    </>
  );
}
export function CbrSil(){

  var watercon=0
  var PRR=[2,4,6,8,10,12,14]
  var diaL=[6,9,13,15,19,24,28]
  var diaU=[0,0,0,0,0,0,0]

  for(var i=0;i<PRR.length;i++){

    PRR[i]=PRR[i]*5*5.3
    diaL[i]=diaL[i]*0.01
    diaU[i]=diaU[i]*0.01

  }
  return (
    <>

    </>
  );
}

export default (Cbr,CbrSil);
